import React from 'react';
import { Link } from 'react-router-dom';

import { Grid, Typography } from '@material-ui/core';

const Links = () => {

    return (
        <Grid item xs={12}>

            <Typography variant="h1">
                A Mountain Dream
            </Typography>

            <Typography>
                <Link style={{ textDecoration: 'none', color: 'inherit' }} to={'/blog'}>
                    Blog
                </Link>
            </Typography>

        </Grid>
    );
};

export default Links;
